Here is a sample code for a chrome extension that takes screenshots of the current tab and saves them to a folder on your computer:
```
// chrome extension code
chrome.runtime.onInstalled.addListener(function() {
  chrome.storage.sync.set({color: '#3aa757'}, function() {
    console.log('The color is green.');
  });
});

chrome.tabs.onUpdated.addListener(function(tabId, changeInfo, tab) {
  if (changeInfo.status === 'complete') {
    chrome.tabs.captureVisibleTab(null, {format: 'png'}, function(dataUrl) {
      var filename = 'screenshot-' + Date.now() + '.png';
      chrome.downloads.download({
        url: dataUrl,
        filename: filename,
        saveAs: false
      });
    });
  }
});
```
In this code, we first define a function that is called when the extension is installed. This function sets the color of the extension’s icon to green. We then define a function that is called when a tab is updated. This function checks if the tab is complete, and if so, it takes a screenshot of the tab and saves it to a folder on the user’s computer. The filename is generated using the current date and time.

